				const matchingSymbol = markets.map(market => market.id).find(id => id === symbol);
				if (!matchingSymbol) {
					response.redirect("/404");
				} else {
					response.sendFile(path.join(process.cwd(), "views", "botview.html"));
				}
			});
	}
});


export default router;

